function spritesEngine() {
  this.sprites = {
    'FROG': 'data:image/png;base64,',
    'LOG':  'data:image/png;base64,',
    'CAR':  'data:image/png;base64,',
    'CARL': 'data:image/png;base64,',
    'TRUCK':'data:image/png;base64,',
    'TRUCKL':'data:image/png;base64,',
    'SAFE_ZONE':'data:image/png;base64,'
  };
  for(key in this.sprites) {
    this.sprites[key] = loadImage(this.sprites[key]);  
  }
  this.getImage = function(key) {
    return this.sprites[key];
  }
}